function sortForDefaultAnswer(arr) {
  // if (sorted.length == arr.length) {
  //     return;
  // }
  for (let item of arr) {
    // Check existed ?
    if (sorted.find(o => o == item.UIFormControlName)) {
      continue;
    }

    item.DefaultAnswer = item.DefaultAnswer.replace(/\[PopulateCB\]/g, '"true"');

    let allMatches = [];
    let matches;

    do {
      matches = /\[([^\]]+)\]/.exec(item.DefaultAnswer);

      if (matches) {
        let match = matches[1];

        if (match.indexOf("DB.") == 0) {
          item.DefaultAnswer = item.DefaultAnswer.replace("[" + match + "]", "AAA");
          // Push to sorted array
          if (!sorted.find(o => o == item.UIFormControlName)) {
            sorted.push(item.UIFormControlName);
          }
        } else {
          item.DefaultAnswer = item.DefaultAnswer.replace("[" + match + "]", "AAA");
          if (sorted.find(o => o == match)) {
            continue;
          }
          let found = arr.find(o => o.UIFormControlName == match);

          if (found) {
            if (found.UIFormControlName != item.UIFormControlName) {
              allMatches.push(found);
            } else {
              if (!sorted.find(o => o == found.UIFormControlName)) {
                sorted.push(found.UIFormControlName);
              }
            }
          }
        }
      } else {
        if (!sorted.find(o => o == item.UIFormControlName)) {
          // Push to sorted array
          sorted.push(item.UIFormControlName);
        }
      }
    } while (matches);

    // Recursion
    if (allMatches.length > 0) {
      sortForDefaultAnswer(allMatches);
    }
  }
}

module.exports = router;
